        "screen1dialog12": MessageLookupByLibrary.simpleMessage(
            "Each skill in judo has its own meaning and significance. The forms of movements are countless because each part of the body can be used in all directions, i.e. up and down, left and right.\nThis is among a large number of skills. That is why the need arises. Therefore, if a person practices judo, all his muscles and bones become stronger and stronger, and at the same time the strength of his internal organs increases. Judo can easily develop a harmonious body and make it strong. In the art of this sport, and this makes the individual always ready to exert his best capabilities quickly against the tricks that the opponent may resort to. \nIn this way, this sport develops freedom of movement in the body and full vigilance towards any emergency. physical water"),
        "screen1dialog13": MessageLookupByLibrary.simpleMessage(
            "First: When any individual perseveres in the sport of judo in a reasonable and regular manner, psychological changes occur to him without his knowledge, as his nobility and refinement increase. The immersion of difficulties on his own, that is, to become of a stable psyche. Observing his opponent as well. Therefore, the judo practitioner will gradually develop the strength of the heart, the intensity of the strength, the firmness of determination, composure (self-control), the speed of thought characterized by the health of mental judgment, in addition to being cautious and vigilant in thought."),
        "screen1dialog14": MessageLookupByLibrary.simpleMessage(
            "Often in our daily lives we encounter material or mental obstacles and sometimes we are exposed to some dangers. That is why judo exercises provide us with physical and mental education and teach us valuable youth movements that enable us to protect ourselves when necessary."),
        "screen1dialog15": MessageLookupByLibrary.simpleMessage(
            "The cohesion of hands between two people and another is one of the instinctive actions of human beings, so we see that the most innovative art of cohesion between the types of sports is the cohesion that takes place in judo."),
        "screen1dialog16": MessageLookupByLibrary.simpleMessage(
