        "screen1dialog17": MessageLookupByLibrary.simpleMessage(
            "Therefore, it is considered one of the best competitive sports because it works on personality formation and increases the individual\'s self-confidence, the desire to excel and win, develop courage and achieve a sense of self."),
        "screen1dialog18": MessageLookupByLibrary.simpleMessage(
            "Because judo has ancient traditions and etiquette that go back to two thousand years, this sport was formulated with a number of values ​​and customs, including respect for others, respect for the elderly, not speaking during training, the etiquette of saluting during our path, guiding you, going out and apologizing in case of error, and other etiquette and traditions of the game and its social behaviour. Which affects individuals and thus affects everyone."),
        "screen1dialog19": MessageLookupByLibrary.simpleMessage(
            "Judo is a sport of different ages, including adults and youth, and people of different shapes and sizes. Therefore, it is considered a sport for all people of all ages. Its effects are in raising the level of physical and health fitness, thus achieving the ideal goal, which is to increase production and raise the livelihood of individuals."),
        "screen1dialog2": MessageLookupByLibrary.simpleMessage(
            "The two men met and fought each other, and each had their own style of fighting, consisting of wrestling skills in their primitive form, and the arts of striking with hand and foot. The battle ended with the killing of the warrior (Taima Nokohama) as a result of a strong blow to the foot and breaking his ribs, and that was the fight in Japan."),
        "screen1dialog20": MessageLookupByLibrary.simpleMessage(
            "(1860)Master Jigoro Kano, the founder of judo, was born.\n_ (1880) Jigoro Kano was appointed director of the University of Tokyo. \n_ (1882) The International Kodokan Institute was founded.\n_ (1886) The sport of judo spread in Japanese schools and universities. \n_ ( 1910) A plan was drawn up to train and educate large numbers of trainers. \n_ (1918) Judo entered England. \n_ (1938) Professor Jigoro Kano passed away. \n_ (1939) Judo entered America. \n_ (1938) The first was held The Japanese Empire Judo Championship.\n_ (1949) The Japanese Amateur Judo Federation was formed.\n_ (1952) The International Judo Federation was established.\n_ (1956) The first World Judo Championship was held.\n_ (1963) The Egyptian Judo Federation was established.\n_ ( 1964) Judo entered the Tokyo Olympics for the first time."),
        "screen1dialog3": MessageLookupByLibrary.simpleMessage(
            "After that, the ruling Japanese Empire took care of this fight. In the year 1375 AD, the Japanese Emperor (Shomo) devised a day for the celebration of the warrior knights, and it is known as (Sandotsu Day), and this celebration included (shooting arrows - archery from horses - Japanese wrestling)."),
        "screen1dialog4": MessageLookupByLibrary.simpleMessage(
            "After 300 years of stopping that day, this celebration was resumed again in the same style, with the aim of showing the royal families the ingenuity of their knights."),
        "screen1dialog5": MessageLookupByLibrary.simpleMessage(
            "In that period, one of the samurai knights laid the first stone in the sport of judo, which is the method of (Kumi Uchi), which is the method of fighting hand to hand, and this method was known after that as (Jujitsu)."),
        "screen1dialog6": MessageLookupByLibrary.simpleMessage(
            "And researchers in Japanese history said that it is possible that the first school arose on the method of (Kumi Uchi) in fighting was in the late sixteenth century and the beginning of the seventeenth century, and that the origin of this art was vague, but the official history of Japan, which was written by the emperor in the year 720 AD, referred to a cycle ( Lekar-Korea-Struggle of Power) in which I practiced this sport."),
        "screen1dialog7": MessageLookupByLibrary.simpleMessage(
            "Jujitsu is the art of combat during war, and it was without rules. Its goal was to preserve life by killing the opponent, as defeat meant death and victory meant life. It was used by ancient Japanese warriors (samurai), the nobility, and rulers. It originated from Tibet, then spread to China and from there to Japan. The credit for bringing it to Japan goes to a student named Akamatsu Oshito from Nishijin, Nagasaki, who was studying in China. He noticed that when a strong wind blew on a large willow tree, it would break under the force of the wind, while the branches of the soft and slender cherry tree would bend and then return to their original position after the wind subsided. From here, the spiritual philosophy of this art was built, based on the saying, (Do not be rigid,) meaning that having fixed muscular strength would lead to breaking, as there is always someone stronger when compared. (Do not be weak) meaning that having a weak body without physical fitness would create difficulties. Instead, be strong by acquiring elements of flexibility, strength, speed, endurance, and agility, combined with fundamental skills to give you high mobility. Jujitsu has risks and moves that can lead to death in some cases."),
        "screen1dialog8": MessageLookupByLibrary.simpleMessage(
            "The art of jujitsu has different schools, among the oldest and most famous"),
